pragma solidity ^0.8.7;

/*
calling parent function
-direct
-super 
*/

contract E {
    event Log (string message);

    function foo() public virtual {
        emit Log("E.foo");
    }

    function bar() public virtual {
        emit Log("E.bar");
    }
}

contract F is E {
    function foo() public virtual override {
        emit Log("E.foo");
        foo();
    }

    function bar() public override {
        emit Log ("E.bar");
        super.bar();
    }
}

